def getminscore(block):
	return (2**block)*(block-1)-(2**(block-2))*4*2/11

close("all")
figure("Speed2048 - tune", figsize=(16,9))

binsize = 200
bins = int(len(scores) / binsize)
x = array(range(bins))
mu = array([mean(scores[i * binsize : (i + 1) * binsize]) for i in x])
q20 = array([percentile(scores[i * binsize : (i + 1) * binsize], 20) for i in x])
q40 = array([percentile(scores[i * binsize : (i + 1) * binsize], 40) for i in x])
q60 = array([percentile(scores[i * binsize : (i + 1) * binsize], 60) for i in x])
q80 = array([percentile(scores[i * binsize : (i + 1) * binsize], 80) for i in x])

subplot(2, 1, 1)
fill_between(x, q20, q80, color="gray", alpha=0.15)
fill_between(x, q40, q60, color="gray", alpha=0.15)
plot(x, mu, "-o", label="avg score")
legend(loc="upper right")
xlabel("Bin")
ylabel("Score")
grid()

subplot(2, 1, 2)
for value in range(11, 15):
	threshold = getminscore(value)
	passed = array([mean(scores[i * binsize : (i + 1) * binsize] > threshold) * 100 for i in x])
	plot(x, passed, "-o", label=("passed %d" % (1 << value)))
legend(loc="upper right")
xlabel("Bin")
ylabel("Probability (%)")
grid()

tight_layout()
show()
